.wrapper {
  max-width: 1300px;
  margin: 0 auto;
}

.frontpage {
  display: grid;
  grid-template-columns: repeat(13, 100px);
  grid-template-rows: repeat(14, 100px);
  margin-top: 1rem;
  border-right: 1px solid #cdcdcd;
}

.nav {
  grid-area: 1/2/2/12;
  align-self: end;
  margin: 0 0 0.8rem 0;
}
.nav__logo {
  font-size: 3rem;
  font-weight: 700;
  color: #1A2225;
  align-self: end;
}

.hero__main {
  grid-area: 2/2/8/12;
  background-image: url(d2220bf984a0d7880062707f0f0b5fd4.jpg);
  background-position: center;
  background-size: cover;
  margin: 0;
  background-repeat: no-repeat;
  object-fit: cover;
}

.hero__side {
  z-index: 50;
  grid-area: 3/9/11/14;
  background-image: url(d71cbd41d512494b7e9a7f8c82f6533b.jpg);
  background-position: center;
  background-size: cover;
  margin: 0;
  filter: grayscale(40%);
  box-shadow: 2px 3px 19px -6px rgba(0, 0, 0, 0.55);
}

.aboutUs {
  grid-area: 9/2/14/8;
  background-color: lightcoral;
  margin: 0;
}

section {
  height: 600px;
  background-color: #F3F4F6;
  border-left: 1px solid #cdcdcd;
}

section:nth-child(odd) {
  background-color: white;
}

* {
  box-sizing: border-box;
  margin: 0;
  font-family: "Major Mono Display", monospace;
}

body {
  margin: 0;
}

a {
  text-decoration: none;
  font-weight: 700;
  color: white;
}
